import React,{useContext} from 'react';
import {Link} from 'react-router-dom';
import { UserContext } from '../App';
import Signin from './pages/Signin';
const Navbar = () => {
    const {state,dispatch} = useContext(UserContext)
    const renderList=()=>{
        if(state){
            return[
                <li><Link to="/signin" className="sign" >Sign In</Link></li>,
                <li><Link to="/profile"><i class="large material-icons">account_circle</i></Link></li>
                

            ]
        }
        else{
            return[
                <li><Link to="/signin" className="signin" >Sign In</Link></li>,
                <li><Link to="/signup">Sign Up</Link></li>
            ]
        }
    }

    return (
        <nav>
            <div className="nav-wrapper">
                <Link to="/home" className="brand-logo">mYeat</Link>
                <ul id="nav-mobile" className="right">
                    {renderList()}
                </ul>
            </div>
        </nav>
    );
}
export default Navbar;
